import React from 'react';
import './index.css';

function App() {
  return (
    <div className="h-screen bg-gradient-to-b from-[#004AAD] to-[#ffffff] flex items-center justify-center">
      <div className="bg-white p-10 rounded-xl shadow-lg w-full max-w-md">
        <h1 className="text-3xl font-bold mb-6 text-center text-[#004AAD]">Welcome Back</h1>
        <form className="space-y-4">
          <input type="text" placeholder="Username" className="w-full p-3 border rounded-lg" />
          <input type="password" placeholder="Password" className="w-full p-3 border rounded-lg" />
          <button type="submit" className="w-full bg-[#004AAD] text-white p-3 rounded-lg hover:bg-blue-700">Login</button>
        </form>
      </div>
    </div>
  );
}

export default App;
